sys_variable_value.value:
(function execute(inputs, outputs) {
  try {
    var successStatusCodes = ['201'];
    var errorMessages = {
      'Project Not Found': 'Invalid Project ID.',
      'can\'t use same project/branch for source and target': 'Source and target branches cannot be the same.',
      'merge request already exists for this source branch': 'Another open merge request already exists for this source branch.',
    };
    var callbackFunction = function(inputs, outputs, errorMessages) {
      var responseBody = JSON.parse(inputs.responseBody);
      outputs.merge_request_id = responseBody.id;
      outputs.merge_status = responseBody.merge_status;
      outputs.web_url = responseBody.web_url;
      return outputs;
    };
    outputs = new x_snc_gitlab.GitLabUtils().postProcess(inputs, outputs, errorMessages, successStatusCodes, callbackFunction);
  } catch (e) {
    outputs = new x_snc_gitlab.GitLabErrorHandler(e).handleError(inputs, outputs, errorMessages);
  }
})(inputs, outputs);

